import React, { useEffect, useState } from "react"
import ReactDOM from "react-dom/client";

const UseWeatherApi = () => {
    const [weather, setWeather] = useState([])

    let fetchWeather = () => {
        fetch("https://weather.visualcrossing.com/VisualCrossingWebServices/rest/services/timeline/melbourne?unitGroup=metric&elements=datetime%2CdatetimeEpoch%2Ctempmax%2Ctempmin%2Ctemp%2Cfeelslike%2Csunrise%2Csunset&key=JB7CB9FV8WLE3SE7N3AYLFWT9&contentType=json", {
            "method": "GET",
            "headers": {
                'Content-Type': 'application/json'
            }
            })
        .then(response => {
            return response.json()
        })
        .then(data => {
            setWeather(data);
            console.log(data)
        })
        .catch(error => console.log(error));
    }

    useEffect(() => {
        fetchWeather()
    }, [])
    console.log(weather.address)
    
    return(
        <div>
        {weather.length > 0 && (
          <ul>
            {weather.map(weather => (
              <li key={weather.id}>{weather.name}</li>
            ))}
          </ul>
        )}
      </div>
    )
}


export default UseWeatherApi
